rect.style:
color: #000;
              display: inline;
              overflow: visible;
              visibility: visible;
              fill: none;
              fill-opacity: 1;
              stroke: rgba(204, 170, 102, 1);
              stroke-width: 6;
              stroke-linecap: butt;
              stroke-linejoin: round;
              stroke-miterlimit: 4;
              stroke-dasharray: none;
